INSERT INTO `wp_posts` VALUES (1,2,'2018-01-29 08:12:42','2018-01-29 08:12:42','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','publish','open','open','','hello-world','','','2018-01-29 08:12:42','2018-01-29 08:12:42','',0,'http://do.ready-for-feedback.com/561-media/seal-house/?p=1',0,'post','',1),(2,2,'2018-01-29 08:12:42','2018-01-29 08:12:42','','Home','','publish','closed','open','','home','','','2018-02-01 15:18:39','2018-02-01 15:18:39','',0,'http://do.ready-for-feedback.com/561-media/seal-house/?page_id=2',0,'page','',0),(3,0,'2018-01-29 08:12:51','2018-01-29 08:12:51','	<div class=\"row columns\">\r\n\r\n		<h2>Headings</h2>\r\n		<h1>Header one</h1>\r\n		<h2>Header two</h2>\r\n		<h3>Header three</h3>\r\n		<h4>Header four</h4>\r\n		<h5>Header five</h5>\r\n		<h6>Header six</h6>\r\n		<h2>Blockquotes</h2>\r\n		<p>Single line blockquote:</p>\r\n		<blockquote><p>Stay hungry. Stay foolish.</p></blockquote>\r\n		<p>Multi line blockquote with a cite reference:</p>\r\n		<blockquote><p>People think focus means saying yes to the thing youve got to focus on. But thats not what it means at all. It means saying no to the hundred other good ideas that there are. You have to pick carefully. Im actually as proud of the things we havent done as the things I have done. Innovation is saying no to 1,000 things.</p></blockquote>\r\n		<p><cite>Steve Jobs</cite>  Apple Worldwide Developers Conference, 1997</p>\r\n		<h2>Tables</h2>\r\n		<table>\r\n			<thead>\r\n				<tr>\r\n					<th>Employee</th>\r\n					<th>Salary</th>\r\n					<th></th>\r\n				</tr>\r\n			</thead>\r\n			<tbody>\r\n				<tr>\r\n					<th><a href=\"http://example.org/\">John Doe</a></th>\r\n					<td>$1</td>\r\n					<td>Because thats all Steve Jobs needed for a salary.</td>\r\n				</tr>\r\n				<tr>\r\n					<th><a href=\"http://example.org/\">Jane Doe</a></th>\r\n					<td>$100K</td>\r\n					<td>For all the blogging she does.</td>\r\n				</tr>\r\n				<tr>\r\n					<th><a href=\"http://example.org/\">Fred Bloggs</a></th>\r\n					<td>$100M</td>\r\n					<td>Pictures are worth a thousand words, right? So Jane x 1,000.</td>\r\n				</tr>\r\n				<tr>\r\n					<th><a href=\"http://example.org/\">Jane Bloggs</a></th>\r\n					<td>$100B</td>\r\n					<td>With hair like that?! Enough said</td>\r\n				</tr>\r\n			</tbody>\r\n		</table>\r\n		<h2>Definition Lists</h2>\r\n		<dl>\r\n			<dt>Definition List Title</dt>\r\n			<dd>Definition list division.</dd>\r\n			<dt>Startup</dt>\r\n			<dd>A startup company or startup is a company or temporary organization designed to search for a repeatable and scalable business model.</dd>\r\n			<dt>#dowork</dt>\r\n			<dd>Coined by Rob Dyrdek and his personal body guard Christopher Big Black Boykins, Do Work works as a self motivator, to motivating your friends.</dd>\r\n			<dt>Do It Live</dt>\r\n			<dd>Ill let Bill OReilly will <a title=\"We\'ll Do It Live\" href=\"https://www.youtube.com/watch?v=O_HyZ5aW76c\">explain</a> this one.</dd>\r\n		</dl>\r\n		<h2>Unordered Lists (Nested)</h2>\r\n		<ul>\r\n			<li>List item one\r\n				<ul>\r\n					<li>List item one\r\n						<ul>\r\n							<li>List item one</li>\r\n							<li>List item two</li>\r\n							<li>List item three</li>\r\n							<li>List item four</li>\r\n						</ul>\r\n					</li>\r\n					<li>List item two</li>\r\n					<li>List item three</li>\r\n					<li>List item four</li>\r\n				</ul>\r\n			</li>\r\n			<li>List item two</li>\r\n			<li>List item three</li>\r\n			<li>List item four</li>\r\n		</ul>\r\n		<h2>Ordered List (Nested)</h2>\r\n		<ol>\r\n			<li>List item one\r\n				<ol>\r\n					<li>List item one\r\n						<ol>\r\n							<li>List item one</li>\r\n							<li>List item two</li>\r\n							<li>List item three</li>\r\n							<li>List item four</li>\r\n						</ol>\r\n					</li>\r\n					<li>List item two</li>\r\n					<li>List item three</li>\r\n					<li>List item four</li>\r\n				</ol>\r\n			</li>\r\n			<li>List item two</li>\r\n			<li>List item three</li>\r\n			<li>List item four</li>\r\n		</ol>\r\n		<h2>HTML Tags</h2>\r\n		<p>These supported tags come from the WordPress.com code <a title=\"Code\" href=\"http://en.support.wordpress.com/code/\">FAQ</a>.</p>\r\n		<p><strong>Address Tag</strong></p>\r\n		<address>1 Infinite Loop<br>\r\n			Cupertino, CA 95014<br>\r\n		United States</address>\r\n		<p><strong>Anchor Tag (aka. Link)</strong></p>\r\n		<p>This is an example of a <a title=\"Apple\" href=\"http://apple.com\">link</a>.</p>\r\n		<p><strong>Abbreviation Tag</strong></p>\r\n		<p>The abbreviation <abbr title=\"Seriously\">srsly</abbr> stands for seriously.</p>\r\n		<p><strong>Acronym Tag (<em>deprecated in HTML5</em>)</strong></p>\r\n		<p>The acronym <acronym title=\"For The Win\">ftw</acronym> stands for for the win.</p>\r\n		<p><strong>Big Tag&nbsp;<strong>(<em>deprecated in HTML5</em>)</strong></strong></p>\r\n		<p>These tests are a <big>big</big> deal, but this tag is no longer supported in HTML5.</p>\r\n		<p><strong>Cite Tag</strong></p>\r\n		<p>Code is poetry. <cite>Automattic</cite></p>\r\n		<p><strong>Code Tag</strong></p>\r\n		<p>You will learn later on in these tests that <code>word-wrap: break-word;</code> will be your best friend.</p>\r\n		<p><strong>Delete Tag</strong></p>\r\n		<p>This tag will let you <del>strikeout text</del>, but this tag is no longer supported in HTML5 (use the <code>&lt;strike&gt;</code> instead).</p>\r\n		<p><strong>Emphasize Tag</strong></p>\r\n		<p>The emphasize tag should <em>italicize</em> text.</p>\r\n		<p><strong>Insert Tag</strong></p>\r\n		<p>This tag should denote <ins>inserted</ins> text.</p>\r\n		<p><strong>Keyboard Tag</strong></p>\r\n		<p>This scarcely known tag emulates <kbd>keyboard text</kbd>, which is usually styled like the <code>&lt;code&gt;</code> tag.</p>\r\n		<p><strong>Preformatted Tag</strong></p>\r\n		<p>This tag styles large blocks of code.</p>\r\n		<pre>.post-title {\r\n			margin: 0 0 5px;\r\n			font-weight: bold;\r\n			font-size: 38px;\r\n			line-height: 1.2;\r\n			and here\'s a line of some really, really, really, really long text, just to see how the PRE tag handles it and to find out how it overflows;\r\n		}</pre>\r\n		<p><strong>Quote Tag</strong></p>\r\n		<p><q>Developers, developers, developers</q> Steve Ballmer</p>\r\n		<p><strong>Strike Tag&nbsp;<strong>(<em>deprecated in HTML5</em>)</strong></strong></p>\r\n		<p>This tag shows <span style=\"text-decoration: line-through;\">strike-through text</span></p>\r\n		<p><strong>Strong Tag</strong></p>\r\n		<p>This tag shows <strong>bold<strong> text.</strong></strong></p>\r\n		<p><strong>Subscript Tag</strong></p>\r\n		<p>Getting our science styling on with H<sub>2</sub>O, which should push the 2 down.</p>\r\n		<p><strong>Superscript Tag</strong></p>\r\n		<p>Still sticking with science and Isaac Newtons E = MC<sup>2</sup>, which should lift the 2 up.</p>\r\n		<p><strong>Teletype Tag&nbsp;<strong>(<em>deprecated in HTML5</em>)</strong></strong></p>\r\n		<p>This rarely used tag emulates <tt>teletype text</tt>, which is usually styled like the <code>&lt;code&gt;</code> tag.</p>\r\n		<p><strong>Variable Tag</strong></p>\r\n		<p>This allows you to denote <var>variables</var>.</p>\r\n\r\n	</div>\r\n','HTML Markup','','publish','closed','closed','','html-markup','','','2018-01-29 08:12:51','2018-01-29 08:12:51','',0,'http://do.ready-for-feedback.com/561-media/seal-house/index.php/html-markup/',0,'page','',0),(4,0,'2018-01-29 08:13:01','2018-01-29 08:13:01','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Leicester City, XYZ employs over 2,000 people and does all kinds of awesome things for the Leicester community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://do.ready-for-feedback.com/561-media/seal-house/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Home','','inherit','closed','closed','','2-revision-v1','','','2018-01-29 08:13:01','2018-01-29 08:13:01','',2,'http://do.ready-for-feedback.com/561-media/seal-house/2-revision-v1/',0,'revision','',0),(9,3,'2018-01-29 08:23:24','2018-01-29 08:23:24','','seal-house-icon','','inherit','open','closed','','seal-house-icon','','','2018-01-29 08:23:24','2018-01-29 08:23:24','',0,'http://do.ready-for-feedback.com/561-media/seal-house/wp-content/uploads/2018/01/seal-house-icon.png',0,'attachment','image/png',0),(10,3,'2018-01-29 08:23:32','2018-01-29 08:23:32','http://do.ready-for-feedback.com/561-media/seal-house/wp-content/uploads/2018/01/cropped-seal-house-icon.png','cropped-seal-house-icon.png','','inherit','open','closed','','cropped-seal-house-icon-png','','','2018-01-29 08:23:32','2018-01-29 08:23:32','',0,'http://do.ready-for-feedback.com/561-media/seal-house/wp-content/uploads/2018/01/cropped-seal-house-icon.png',0,'attachment','image/png',0),(11,3,'2018-01-29 08:38:07','2018-01-29 08:38:07','','CATEGORIES','','publish','closed','closed','','shop','','','2018-01-31 14:10:34','2018-01-31 14:10:34','',0,'http://do.ready-for-feedback.com/561-media/seal-house/shop/',0,'page','',0),(12,1,'2018-01-29 08:38:08','2018-01-29 08:38:08','[woocommerce_cart]','Basket','','publish','closed','closed','','basket','','','2018-01-29 08:38:08','2018-01-29 08:38:08','',0,'http://do.ready-for-feedback.com/561-media/seal-house/basket/',0,'page','',0),(13,3,'2018-01-29 08:38:08','2018-01-29 08:38:08','[woocommerce_